text:
Today, I’m introducing the Bipartisan Premium Tax Credit Extension Act alongside @RepTomSuozzi. This legislation will protect Virginia families, seniors, and small business owners from massive health care premium increases. 

@RepGolden, @RepJeffHurd, @RepBresnahan, @RepYoungKim, @RepDavidValadao, @RepCarlos, @CongressmanKean, @RepCiscomani, @RepMikeLawler, @RepDonDavis
